VALUES('55849f95-7436-462f-861c-a0ddb6437004', 'Rosca de Punho com Barra Sentado', '4', '12', '10', '60', 'https://www.youtube.com/watch?v=x4q8CEgNcZY', 'Sente-se em um banco e apoie os antebraços nas coxas, segurando a barra com as palmas voltadas para cima. Deixe os pulsos levemente para fora dos joelhos e abaixe a barra lentamente. Em seguida, flexione os punhos para cima, contraindo os antebraços, e retorne à posição inicial.', '2025-03-02 05:59:05.425', '2025-03-02 05:59:05.425', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-de-punho-com-barra-sentado.png', '00390cbe-cf6f-4a5e-850a-9bf3550d335f');
VALUES('e9253c3b-f087-4675-9ea5-879fe8da0885', 'Rosca de Punho com Barra por Trás do Corpo', '4', '12', '10', '60', 'https://www.youtube.com/watch?v=TvDgrGNPzeQ', 'Fique em pé segurando a barra atrás do corpo, com as palmas voltadas para trás e os braços estendidos. Deixe os punhos relaxarem para baixo, permitindo que a barra desça levemente. Em seguida, flexione os punhos para cima, contraindo os antebraços, e retorne lentamente à posição inicial.', '2025-03-02 06:03:13.239', '2025-03-02 06:03:13.239', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-de-punho-com-barra-por-trás-do-corpo.png', '00390cbe-cf6f-4a5e-850a-9bf3550d335f');
VALUES('40bc08e1-80f3-4310-bc94-6320ae1d0e39', 'Rosca Inversa com Barra', '4', '12', '10', '60', 'https://www.youtube.com/watch?v=CUaRRBbRPgA', 'Segure a barra com as palmas voltadas para baixo (pegada pronada) e os braços estendidos à frente do corpo. Flexione os cotovelos, levantando a barra até a altura dos ombros, mantendo os cotovelos próximos ao corpo. Controle a descida da barra até a posição inicial e repita o movimento.', '2025-03-02 06:06:36.451', '2025-03-02 06:06:36.451', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-inversa-com-barra.png', '00390cbe-cf6f-4a5e-850a-9bf3550d335f');
VALUES('594e43e7-ef14-4559-a2be-fc48af79d68d', 'Rosca Inversa na Polia', '4', '12', '10', '60', 'https://www.youtube.com/watch?v=Ji_KYs4w59U', 'Segure a barra da polia baixa com as palmas voltadas para baixo (pegada pronada) e os braços estendidos. Flexione os cotovelos, trazendo a barra em direção aos ombros, mantendo os cotovelos próximos ao corpo. Controle a descida até a posição inicial e repita o movimento', '2025-03-02 06:07:56.575', '2025-03-02 06:07:56.575', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-inversa-na-polia.png', '00390cbe-cf6f-4a5e-850a-9bf3550d335f');
VALUES('caa13f28-0de3-4a6a-b649-dd7f906e52a9', 'Caminhada do Fazendeiro com Halteres', '4', '12', '10', '60', 'https://www.youtube.com/watch?v=MTxG3rboW9A', 'Segure um haltere em cada mão com os braços estendidos ao lado do corpo. Mantenha a postura ereta, ative o core e caminhe uma distância determinada ou pelo tempo desejado. Evite balançar o corpo e mantenha os ombros estabilizados durante o movimento', '2025-03-02 06:08:54.239', '2025-03-02 06:08:54.239', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/caminhada-do-fazendeiro-com-halteres.png', '00390cbe-cf6f-4a5e-850a-9bf3550d335f');
VALUES('d9052584-7789-48fe-a765-fcd6cc7786cd', 'Rosca de Punho com Halteres Pegada Neutra Sentado', '4', '12', '10', '60', 'https://www.youtube.com/watch?v=x4q8CEgNcZY', 'Sente-se em um banco e apoie os antebraços nas coxas, segurando um haltere em cada mão com pegada neutra (polegares voltados para cima). Deixe os punhos relaxarem para baixo e, em seguida, flexione-os para cima, contraindo os antebraços. Controle a descida dos halteres até a posição inicial e repita o movimento', '2025-03-02 06:10:34.357', '2025-03-02 06:10:34.357', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-de-punho-com-halteres-pegada-neutra-sentado.png', '00390cbe-cf6f-4a5e-850a-9bf3550d335f');
VALUES('8c74661a-d695-431f-918d-748e2ddebd9a', 'Rosca de Punho com Halter Unilateral Sentado', '4', '12', '10', '60', 'https://www.youtube.com/watch?v=agVfOWgs21Y', 'Sente-se em um banco e apoie o antebraço de um dos braços na coxa, segurando um halter com a palma voltada para cima. Deixe o punho relaxar para baixo e, em seguida, flexione-o para cima, contraindo os antebraços. Controle a descida do halter até a posição inicial e repita o movimento antes de trocar de braço.', '2025-03-02 06:11:32.833', '2025-03-02 06:11:32.833', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-de-punho-com-halter-unilateral-sentado.png', '00390cbe-cf6f-4a5e-850a-9bf3550d335f');
VALUES('400c52e2-f7fc-42f5-9ac4-b95fce98cd78', 'Rosca Inversa com Barra EZ', '4', '12', '10', '60', 'https://www.youtube.com/watch?v=41c-KLO0bvc', 'Segure a barra EZ com pegada pronada (palmas para baixo) e os braços estendidos à frente do corpo. Flexione os cotovelos, trazendo a barra em direção aos ombros, mantendo os cotovelos próximos ao corpo. Controle a descida até a posição inicial e repita o movimento.', '2025-03-02 06:12:17.667', '2025-03-02 06:12:17.667', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-inversa-com-barra-ez.png', '00390cbe-cf6f-4a5e-850a-9bf3550d335f');
VALUES('cbfea356-8e84-4f84-b649-7cbeb6c82162', 'Rosca de Punho Inversa com Barra sobre o Banco', '4', '12', '10', '60', 'https://www.youtube.com/watch?v=7HlHT0g2XVQ', 'Ajoelhe-se atrás de um banco e apoie os antebraços sobre a superfície, segurando a barra com pegada pronada (palmas para baixo). Deixe os punhos relaxarem para baixo e, em seguida, flexione-os para cima, contraindo os antebraços. Controle a descida da barra até a posição inicial e repita o movimento.', '2025-03-02 06:13:16.743', '2025-03-02 06:13:16.743', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-de-punho-inversa-com-barra-sobre-o-banco.png', '00390cbe-cf6f-4a5e-850a-9bf3550d335f');
VALUES('c43dbd22-c55a-4244-b0bf-5d72a8a6ca09', 'Caminhada com Anilhas Pinçadas', '4', '12', '10', '60', 'https://www.youtube.com/shorts/_7surmCE6pY', 'Segure uma ou duas anilhas entre os dedos e o polegar, apertando-as firmemente para manter a pegada. Mantenha a postura ereta, ative o core e caminhe uma distância determinada ou pelo tempo desejado. Evite deixar as anilhas escorregarem e mantenha o controle durante todo o movimento.', '2025-03-02 06:15:23.848', '2025-03-02 06:15:23.848', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/caminhada-com-anilhas-pinçadas.png', '00390cbe-cf6f-4a5e-850a-9bf3550d335f');